import React, { useState } from "react";
import { FaSearch } from "react-icons/fa";
import {
  HeaderImage,
  StyledNavbar,
  StyledContainer,
  RightContainer,
  Add,
  EnButton,
  Links,
  BurgerButton,
  MobileLogo,
  MobileNav,
  MobileRight,
  HeadIcon,
  HiddenSidebar,
} from "./nav-bar.styles";
import logo from "../../assets/image1.svg";
import BurgerList from "../UI/BurgerList/BurgerList";

const Navbar = () => {
  const [isClicked, setIsClicked] = useState(false);



  const clickHandler = () => {
    setIsClicked(!isClicked);
  };

  return (
    <StyledNavbar>
      <StyledContainer>
        <HeaderImage image={logo}>
          <img src={logo} alt="" />
        </HeaderImage>
        <ul>
          <li>Movies</li>
          <li>TV Shows</li>
          <li>People</li>
          <li>More</li>
        </ul>
      </StyledContainer>
      <RightContainer>
        <Add />
        <EnButton>EN</EnButton>
        <Links>Login</Links>
        <Links>Join TMDB</Links>
        <Links>
          <FaSearch size={20} color="#00B4E4" />
        </Links>
      </RightContainer>
      <MobileNav>
        <BurgerButton onClick={clickHandler} />
        <MobileLogo />
        <MobileRight>
          <HeadIcon />
          <FaSearch size={20} color="#00B4E4" />
        </MobileRight>
        <HiddenSidebar isClicked={isClicked}>
          <BurgerList />
        </HiddenSidebar>
      </MobileNav>
    </StyledNavbar>
  );
};
export default Navbar;
